['#include<bits/stdc++.h>
using namespace std;
int main()
{
    int  n,k;
    cin>>n>>k;
    int *choice=new int[n];
    for(int i=0;i<n;i++)
    {
        cin>>choice[i];
    }
    int freq[k+1]={0};
    for(int i=0;i<n;i++)
    {
        freq[choice[i]]=freq[choice[i]]+1;
    }
    priority_queue<int>pq;
    for(int i=0;i<=k;i++)
    {
        if(freq[i])
        {
            pq.push(freq[i]);
        }
    }
    int p;
    if(n%2==0)
    {
        p=n/2;
    }
    else
    {
        p=(n/2)+1;
    }
    int m,odd=0;
    int count1=0,u;
    int ans=0;
    while(count1<p && !pq.empty())
    {
        u=pq.top();
        //cout<<u<<" ";
        pq.pop();
        m=u/2;
        if(count1+m>p)
        {
            ans=ans+(p-count1)*2;
            count1=p;
            break;
        }
        if(u%2!=0)
        {
            odd=odd+1;
        }
        count1=count1+m;
        ans=ans+(m*2);
       // cout<<ans<<" "<<count1<<endl;
    }
    if(count1<p)
    {
       if(odd<(p-count1))
       {
           ans=ans+odd;
       }
       else
       {
          // cout<<p<<" "<<count1<<" "<<(count1-p)<<" "<<ans<<endl;
           ans=ans+(p-count1);
       }
    }
    cout<<ans;
}
