['#include <bits/stdc++.h>
using namespace std;
typedef long long ll;
typedef unsigned long long ull;
int main()
{
    int n,k;
    cin >> n >> k;
    int a[k]={0},temp;
    for(int i=0;i<n;i++)
    {
        cin >> temp;
        a[temp-1]++;
    }
    int nn=n/2;
    if(n%2!=0)
        nn++;
    sort(a,a+k);
    ll ans=0;
    for(int i=0;i<k && nn>0;i++)
    {
        if(a[i]%2==0 && a[i]!=0)
        {
            if((nn*2)>=a[i])
            {
                nn=nn-a[i]/2;
                ans+=a[i];
                a[i]=0;
            }
            else
            {
                nn=0;
                ans+=nn*2;
                a[i]=0;
            }
        }
        else if(a[i]>2 && a[i]%2!=0)
        {
            if((nn*2)>=a[i])
            {
                nn=nn-a[i]/2;
                ans=ans+a[i]-1;
                a[i]=1;
            }
            else
            {
                nn=0;
                ans=ans+nn*2;
            }
        }
    }
    for(int i=0;i<n && nn>0;i++)
    {
        if(a[i]%2!=0 && a[i]!=0)
        {
            if((nn*2)>a[i])
            {
                nn=nn-a[i]/2;
                nn--;
                ans=ans+a[i];
                a[i]=0;
            }
            else
            {
                nn=0;
                ans=ans-1+nn*2;
                a[i]=0;
            }
        }
    }
    cout << ans;
    return 0;
}
