['#include <bits/stdc++.h>
using namespace std;

const int limN = 4000;

int bu[limN];
priority_queue< pair<int,int> > pq;

int solve(int n, int k){
    int total = 0;
    int sets = n/2;
    if(n%2 == 1)sets++;
    for(int i=0; i<sets; i++){
        pair<int,int> act = pq.top();
        pq.pop();
        if( act.first > 1 ){
            act.first -= 2;
            total += 2;
        }
        else {
            act.first --;
            total ++;
        }
        pq.push(act);
    }
    return total;
}

int main (){

    int n,k;
    scanf("%d%d",&n,&k);
    for(int i=0; i<n; i++){
        int x;
        scanf("%d",&x);
        bu[x]++;
    }
    for(int i=0; i<limN; i++){
        if(bu[i] > 0){
            pq.push( {bu[i],i} );
        }
    }
    printf("%d\n",solve(n,k));

    return 0;
}
