int calculateSets(int n){
    if(n %2 == 0){ return n/2; }
    else{ return (n/2)+1; }
}

int main(){
    int n,k;
    scanf("%d%d",&n,&k);
    int setDrinks = calculateSets(n);

    for(int i=0; i<n; i++){
        int a;
        scanf("%d",&a);
        bucket[a]++;
    }
    int totalStudents = 0;
    int pos = 0;
    for(pair <int,int> a : bucket){
        if(a.second %2 == 0){
            totalStudents += a.second;
            setDrinks-=a.second/2;
        }
        else{
            impares[pos] = a.second;
            pos++;
        }
    }
    sort(impares,impares+pos);
    for(int i = pos-1; i>=0; i--){
        if(setDrinks>0){
            int x = calculateSets(impares[i]);
            if(x <= setDrinks){
                totalStudents += (x*2) - 1;
                setDrinks-=x;
            }
            else{
                totalStudents += setDrinks*2;
                setDrinks = 0;
            }
        }
    }
    printf("%d",totalStudents);
    return 0;
}
