['#include <bits/stdc++.h>
using namespace std;
#define ll long long
#define umap unordered_map
#define uset unordered_set
#define MX 100001
#define mod 1000000007LL
#define test ll cases; cin>>cases; for(ll testCase = 1; testCase <= cases; testCase++)   //test cases
#define rep(i, begin, end, upd)  for(ll i = begin; ((begin < end && upd > 0 && i < end) || (begin > end && upd < 0 && i >= end)); i+=upd)
#define fill(name, val) memset(name, val, sizeof(name))
#define error(x) fixed<<setprecision(x) //cout<<error(5)<<someDouble    -> example - 3.14159
#define vll vector<ll>
#define vvll vector<vll>
#define inf 1e18
#define take(array, n) for(ll index = 0; index < n; index++) cin>>array[index];
#define boost ios_base::sync_with_stdio(false); cin.tie(NULL); cout.tie(NULL)
ll gcd(ll a, ll b){
	while(b){
		a %= b;
		swap(a, b);
	}
	return a;
}
ll modMult(ll a, ll b, ll m = mod){
	return ((a%m)*(b%m))%m;
}
ll modAdd(ll a, ll b, ll m = mod){
    return (a%m + b%m)%m;
}
ll power(ll x, ll n, ll m = mod){
	x %= m;	ll res = 1;
	while(n){
		if(n&1)	res = modMult(res, x, m);
		x = modMult(x, x, m);
		n >>= 1;
	}
	return res;
}
ll fermatInv(ll x, ll m = mod){
    if(gcd(x, m) != 1)  return -1;
    return power(x, m-2, m);
}
vll primeSieve(ll n = MX){
	vll primes;
    bool nums[n];   fill(nums, true);
    primes.push_back(2);
    rep(i, 4, n, 2)   nums[i] = false;
    rep(i, 3, n, 2){
        if(nums[i]){
            primes.push_back(i);
            rep(j, i*i, n, i) nums[j] = false;
        }
    }
	return primes;
}
vll factorize(ll n){
    vll res;
    ll rootn = sqrt(n);
    rep(i, 1, rootn+1, 1){
        if(n % i == 0){
            res.push_back(i);
            if(n/i != i)    res.push_back(n/i);
        }
    }
    return res;
}
vvll idMatrix(vvll matrix){
	vvll id = matrix;
	rep(i, 0, id.size(), 1)
		rep(j, 0, id[i].size(), 1)
			id[i][j] = (i==j);
	return id;
}
vvll matrixMult(vvll mx1, vvll mx2, ll m = mod){
	ll r = mx1.size(), c1 = mx2.size(), c = mx2[0].size();
	vvll result(r);
	rep(i, 0, r, 1)
		rep(j, 0, c, 1){
			ll sum = 0;
			rep(k, 0, c1, 1)
				sum = (modMult(mx1[i][k], mx2[k][j], m) + sum)%m;
			result[i].push_back(sum);
		}
	return result;
}
vvll matrixExpo(vvll matrix, ll n, ll m = mod){
	if(n == 0)	return idMatrix(matrix);
	vvll sa = matrixExpo(matrix, n/2, m);
	sa = matrixMult(sa, sa, m);
	if(n & 1)	return matrixMult(sa, matrix, m);
	else		return sa;
}
class TreeNode{
    public:
    ll val;
    TreeNode* left;
    TreeNode* right;
    TreeNode(ll v){
        val = v;
        left = right = NULL;
    }
};
class Graph{
    ll N;
    bool weighted;
    unordered_map<ll, unordered_map<ll, ll>> g; //Assume all graphs are weighted. Unweighted => every edge weight = 1
    public:
    Graph(ll n, bool w = false){
        N = n;
        weighted = w;
    }
    void addEdge(ll u, ll v, ll w = 1){
        g[u][v] = w;
    }
    void printEdges(){
        for(auto u : g){
            cout<<u.first<<"-> ";
            for(auto v : u.second){
                cout<<v.first;
                if(weighted) cout<<"("<<v.second<<")";
                cout<<' ';
            }
            cout<<endl;
        }
    }
};
class STree{
	public:
	ll n;
	ll* tree;
	ll queryBase;
	ll segOp(ll left, ll right);
	STree(ll arrLen, ll* arr, ll qb){	//build the tree
		n = arrLen;
		queryBase = qb;
		tree = new ll[2*n];
		rep(i, 0, n, 1)	tree[n+i] = arr[i];
		rep(i, n-1, 0, -1)	tree[i] = segOp(tree[i<<1], tree[i<<1|1]);
	}
	void update(ll index, ll value){	//point update
		for(tree[index += n] = value; index > 1; index >>= 1)	tree[index>>1] = segOp(tree[index], tree[index^1]);
	}
	ll query(ll left, ll right){	// [left, right)
		ll lres = queryBase, rres = queryBase;
		for(left += n, right += n; left < right; left >>= 1, right >>= 1){
			if(left&1) lres = segOp(lres, tree[left++]);
			if(right&1) rres = segOp(rres, tree[--right]);
		}
		return segOp(lres, rres);
	}
};
/*  =======TL;DR=======
    Author : zenolus
    TreeNode (binary tree):
			TreeNode(v)   => create new node with val v
    Graph (Adjacency List representation):
			Graph(nodes, weighted = false)  => create a graph with n nodes, specify if weighted
			addEdge(u, v, weight = 1)   => add an edge in graph, specify weight if necessary
			printEdges() => display the adjacency list
    STree (Segment Tree):
			STree(arrayLength, array, queryBase)	=> create the segment tree
			update(index, value)	=> point update
			query(left, right)	=> query segment operation on [l, r)
		Algorithms :
			gcd(a, b)   => returns gcd of a and b
			power(x, n, m = mod) => return x raised to power n in O(log n) time, if required, specify modulo
			fermatInv(x, m = mod)  => returns modular multiplicative inverse of x with m
			primeSieve(n = MX)   => returns a vector of all the primes till n
			factorize(n)    => returns a vector of factors of n
			modMult(a, b, m = mod)	=> returns (a*b)%m
			idMatrix(matrix)	=> returns an identity matrix of dimensions similar to passed matrix
			matrixMult(A, B, m = mod)	=> returns (A.B)%m
			matrixExpo(A, n, m = mod)	=> returns A power n mod m
    	nCr(n, r, m = mod)  => returns nCr value. ATTENTION: Needs fixing
*/
ll STree::segOp(ll left, ll right){
	return left + right;	//Change per requirement
}

