using namespace std;
typedef long long ll;

ll f(ll j){ 
	return j*(j+1)/2+j;
}


ll bin(ll target){ 
	ll L=0;
	ll R=1e9;
	ll mid;
	while(L<=R){ 
		mid=L+(R-L)/2;
		ll val=f(mid);	
		if(val==target){ 
			return mid;
		} 
		if(val<target){ 
			L=mid+1;
		}else{ 
			R=mid-1;
		} 
	} 
	return mid;
}


int main(){ 
	cin.tie(0);
	ios::sync_with_stdio(false); 
	int n,k;
	cin>>n>>k;
	ll j=bin(k+n);
	cout<<n-j;

	return 0;
}
