['#include<bits/stdc++.h>
using namespace std;
void swap(long long int* a,long long int* b)  
{int t = *a;  
 *a = *b;  
 *b = t;  
}  
long long int partition(long long int arr[],long long int low,long long int high)  
{long long int pivot = arr[high];   
 long long int i = (low - 1); 
 for (long long int j = low; j <= high - 1; j++)  
 {if (arr[j] < pivot)  
  {i++;  
   swap(&arr[i], &arr[j]);  
  }  
 }  
 swap(&arr[i + 1], &arr[high]);  
 return (i + 1);  
}  
void quickSort(long long int arr[],long long int low,long long int high)  
{if (low < high)  
 {long long int pi = partition(arr, low, high);  
  quickSort(arr, low, pi - 1);  
  quickSort(arr, pi + 1, high);  
 }  
}  
int main()
{long long int n,k,a[1009],i,j,ct;
 cin>>n>>k;
 for(i=0;i<n;i++)
 {cin>>a[i];}
 quickSort(a,0,n-1);
 ct=0;
 for(i=0;i<n-1;i++)
 {if(a[i]==a[i+1])
  {a[i]=0;a[i+1]=0;ct+=2;
  }
 }
 j=n-(ct);
 if((j%2)==0)
 {ct+=(j/2);}
 else
 {ct++;
  ct+=(j/2);
 }
 
 cout<<ct;
}
