    int n,k;
    cin >> n >> k;
    int hi=n+1,lo=0,ans;
    while(lo<hi)
    {
        int mid=lo+(hi-lo)/2;
        if(check((ll)mid,(ll)n)>2*(ll)k)
        {
            lo=mid+1;
        }
        else if(check((ll)mid,(ll)n)<2*(ll)k)
        {
            hi=mid;
        }
        else
        {
            ans=mid;
            break;
//            lo=mid+1;
        }
    }
    cout << ans;
    return 0;
}
