["#include<bits/stdc++.h>
#define MOD 1000000007
#define fi(i,a,b) for(ll i = a; i < b; i++)
#define fd(i,a,b) for(ll i = a; i >= b; i--)
#define cfi(container,it) for(auto it = container.begin(); it != container.end(); it++)
#define cfd(container,it) for(auto it = container.rbegin(); it != container.rend(); it++)
#define vi vector<int>
#define vll vector<ll>
#define pb push_back
#define pbx(num) ll temp; cin>>temp; num.pb(temp) 

using namespace std;
typedef long long ll;

struct modll {
	ll num;
	operator ll() {return num;}
};
modll operator *(modll x, modll y) {return {(x.num * y.num) % MOD} ;}
modll operator +(modll x, modll y) {return {(x.num + y.num + MOD) % MOD} ;}


ll sqr(ll x) {

	ll left = 1, right = x/2, mid;

	while(left <= right) {

		mid = left + (right - left)/2;

		if(mid*mid == x) {
			return mid;
		}

		if(mid*mid < x) {
			left = mid + 1;
		} else {
			right = mid - 1;
		}
	}

}

int main(){
	ios::sync_with_stdio(false);
