	ll left = 1, right = x, mid;

	while(left <= right) {

		mid = left + (right - left)/2;

		if(mid*mid == x) {
			return mid;
		}

		if(mid*mid < x) {
			left = mid + 1;
		} else {
			right = mid - 1;
		}
	}

