                c++;
                if(c==(n+1)/2)
                break;
            }
        }
        if(c==(n+1)/2)
        break;
    }
    int d=0;
    for(int i=0;i<k;i++){
        if(count[i]>0){
            d+=count[i];
        }
    }
    cout<<n-d;
