import java.util.*;
import java.io.*;
import java.math.*;

public class Main
{
    private static BufferedReader br = new BufferedReader(new InputStreamReader(System.in));

    private String strVal() throws IOException{
        return br.readLine().trim();
    }

    private long longVal() throws IOException {
        return Long.parseLong(br.readLine().trim());
    }

    private int intVal() throws IOException {
        return Integer.parseInt(br.readLine().trim());
    }

    private double doubleVal() throws IOException {
        return Double.parseDouble(br.readLine().trim());
    }

    private int[] intArr() throws IOException {
        String[] s = br.readLine().trim().split(" ");
        int n = s.length;
        int[] a = new int[n];
        for (int i = 0; i < n; i++) {
            a[i] = Integer.parseInt(s[i]);
        }
        return a;
    }

    private long[] longArr() throws IOException {
        String[] s = br.readLine().trim().split(" ");
        int n = s.length;
        long[] a = new long[n];
        for (int i = 0; i < n; i++) {
            a[i] = Long.parseLong(s[i]);
        }
        return a;
    }

    private double[] doubleArr() throws IOException {
        String[] s = br.readLine().trim().split(" ");
        int n = s.length;
        double[] a = new double[n];
        for (int i = 0; i < n; i++) {
            a[i] = Double.parseDouble(s[i]);
        }
        return a;
    }

    private String[] stringArr() throws IOException {
        String[] s = br.readLine().trim().split(" ");
        return s;
    }

    private char[] charArr() throws IOException {
        return br.readLine().trim().toCharArray();
    }

    class Pair<K,V>{
        K first;
        V second;
        Pair(K a,V b){
            first =a;
            second =b;
        }
        Pair(){
        }
    } 

    public long powMod(long x, long y, long mod) {
        long res = 1;
        while (y > 0) {
            if (y % 2 != 0) {
                res = (res * x) % mod;
            }
            y /= 2;
            x = (x * x) % mod;
        }
        return res;
    }
    
    public static long mod = (long) Math.pow(10, 9) + 7;
    // static HashSet<Integer> hs = new HashSet<Integer>();
    public static String solve() throws IOException {
        Main obj = new Main();
        int[] xx = obj.intArr();
        int n = xx[0] , k =xx[1];
        int[] val = new int[k+1];
        for(int i=0;i<n;i++){
            val[obj.intVal()]++;
        }
        int c = 0;
        int sets = 0;
        int maxSets = (int)Math.ceil(n/2.0);
        for(int i=1;i<=k;i++){
            if(val[i]%2==1)
                c++;
            sets += val[i]/2;
            // System.out.println();
        }
        // System.out.println(maxSets +" "+sets);
        return n-c+maxSets-sets+"";
    }

    public static void main(String[] args) throws IOException
    {
        Main ob = new Main();
    //    int total_test_case = ob.intVal();
        int total_test_case = 1;
        StringBuffer ans = new StringBuffer();
        String k;
        for (int test_case = 0; test_case < total_test_case; test_case++) {
            k = ob.solve();
            // System.out.println(k);
            // ans.append("Case #"+test_case+": "+k+"\n");
            ans.append(k+"\n");
        }
        System.out.print(ans);
    }
} 
